import React, { Component } from "react";

import "../index.css";

class MenuBar extends React.Component {
  render() {
    return (
      <div>
        <div
          className={"menuBar"}
          onClick={() => this.props.handleClick("topic")}>
          Neues Fach
        </div>
        <div className={"menuBar"}>Neue Frage</div>
      </div>
    );
  }
}

export default MenuBar;
